description:
Beverly Hills Chihuahua (2008)  

Verenigde Staten
Avontuur / Komedie
91 minuten

geregisseerd door Raja Gosnell
met de stemmen van Drew Barrymore en Salma Hayek en Jamie Lee Curtis

Tijdens een vakantie in Mexico raakt de verwende chihuahua Chloe uit Beverly Hills opeens verdwaald in de ongure straten. Voor de eerste keer in haar leven moet ze haarzelf zien te redden en noodgedwongen vrienden maken met de plaatselijke dieren om haar weg naar huis te vinden.

Vanaf 22 april in de bioscoop 

